import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#ffffff',
      flexDirection: 'row'
    },
    dayBox: {
      backgroundColor: '#4d98cf',
      flexDirection: 'column',
      marginRight: 50,
      color: '#ffffff',
      borderRadius: 8,
      paddingLeft: 10,
      paddingRight: 10
    }, 
    pages: {
      alignItems: 'center',
    },
  });
